description:
Unforgettable: The Sweeney

Arts Documentary hosted by Martin Glyn Murray, published by ITV in 2012 - English narration


Information
------------------------------

Revealing documentary special looking back at the iconic, ground-breaking 70s cop series. Featuring Dennis Waterman, Ray Winstone - star of the new Sweeney movie - and John Thaw's widow Sheila Hancock.

